import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Card";
import * as serviceWorker from "./serviceWorker";
import { robot } from "./robots";
import Cardlist from "./Cardlist";

ReactDOM.render(
  <React.StrictMode>
    <div>
      {/* <Card id={robots[0].id} title={robots[0].name} email={robots[0].email} />
      <Card id={robots[1].id} title={robots[0].name} email={robots[0].email} />
      <Card id={robots[2].id} title={robots[0].name} email={robots[0].email} /> */}
      <Cardlist robots={robot} />
    </div>
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
